	@Test
	void searchBankCodeByTrie() {
		assertNotNull(bankCodess);
		String[] bankCodeArray = bankCodess.split("\\|\\^");
		assertTrue(bankCodeArray.length == 5556);

		Trie<String> bankCodeTrie = new Trie<>();
		for (String bankCode : bankCodeArray) {
			String[] codeAndName = bankCode.split("\\|");
			assertTrue(codeAndName.length == 2);
			bankCodeTrie.insert(codeAndName[0], codeAndName[1]);
		}
		assertTrue(bankCodeTrie.contains("623052"));
		String accounts = "6230522030022977279,6228480329411074779,6228450176021089663,6259960418508404,6214832164800927";
		String[] accountList = accounts.split(",");
		for (String account : accountList) {
			String longestPrefix = bankCodeTrie.getLongestExistsKey(account);
			String bankName = bankCodeTrie.get(longestPrefix);
			System.out.printf("账户号%s的卡bin为%s归属银行为：%s\n", account, longestPrefix, bankName);
		}
	}
